import React from 'react'

function Interested() {
  return (
    <div className='w-h-screen bg-base-300 mt-20'>
      <div className='flex flex-row p-12 m-auto relative space-x-11'>
        <h1 className='col-1 font-bold text-xl'>Interested working with me ?</h1>
        <button className=' flex-row-reverse'>Email Me</button>
      </div>
    </div>
  )
}

export default Interested
